    public func test(_ s: String) -> Int {
        return lengthOfLongestSubstring(s)
    }

    func lengthOfLongestSubstring(_ s: String) -> Int {
        let count = s.count
        if count == 0 {
            return 0
        }

        var highestFound = 0
        var leftIndex = 0
        var characterSet = Set<Character>()
        let sArray = Array(s)
        for rightIndex in 0..<count {
            let rightCharacter = sArray[rightIndex]
            while characterSet.contains(rightCharacter) {
                characterSet.remove(sArray[leftIndex])
                leftIndex += 1
            }

            characterSet.insert(rightCharacter)
            highestFound = max(highestFound, rightIndex - leftIndex + 1)
        }

        return highestFound
    }

    func lengthOfLongestSubstring_workingSlowly(_ s: String) -> Int {
        func hasUniqueSubstring(_ s: String, _ len: Int) -> Bool {
            let count = s.count
            for idx in 0...count - len {
                let start = s.index(s.startIndex, offsetBy: idx)
                let end = s.index(s.startIndex, offsetBy: idx + len)
                let str = s[start..<end]
                var charSet = Set<Substring.Element>()
                str.forEach { charSet.insert($0) }
                if charSet.count == len {
                    return true
                }
            }

            return false
        }

        var len = 1
        let count = s.count
        if count == 0 {
            return 0
        }

        while len <= count {
            let found = hasUniqueSubstring(s, len)
            if !found {
                return len - 1
            }

            len += 1
        }

        return len - 1
    }

